__ht__function(json, dm, view, datas) {
    var inletValve = dm.getDataByTag('进口阀')
    var bypassValve = dm.getDataByTag('旁通阀')
    var outletValve = dm.getDataByTag('出口阀')
    var ventingBallValveF = dm.getDataByTag('放空球阀前')
    var ventingBallValveB = dm.getDataByTag('放空球阀后')
    var ventingValve = dm.getDataByTag('放空阀')
    var pressurePanel = dm.getDataByTag('压力面板')
    var dischargeBallValveF = dm.getDataByTag('排污球阀前')
    var dischargeBallValveB = dm.getDataByTag('排污球阀后')
    var dischargeValve = dm.getDataByTag('排污阀')
    var pollution = dm.getDataByTag('排污中')
    var dischargePressure = dm.getDataByTag('释压中')
    var boostPressure = dm.getDataByTag('充压中')
    var liquidLevel = dm.getDataByTag('液位')
    var step1 = dm.getDataByTag('步骤1')
    var step2 = dm.getDataByTag('步骤2')
    var step3 = dm.getDataByTag('步骤3')
    var step4 = dm.getDataByTag('步骤4')
    var step5 = dm.getDataByTag('步骤5')
    var step6 = dm.getDataByTag('步骤6')
    var step7 = dm.getDataByTag('步骤7')
    var step8 = dm.getDataByTag('步骤8')
    var step9 = dm.getDataByTag('步骤9')
    var step10 = dm.getDataByTag('步骤10')
    var step11 = dm.getDataByTag('步骤11')
    var step12 = dm.getDataByTag('步骤12')
    var step13 = dm.getDataByTag('步骤13')
    var step14 = dm.getDataByTag('步骤14')
    var star = dm.getDataByTag('开始按钮')
    // 将首个动画作为按钮的属性传过去
    star.a('star', anim1)
    // 1.关闭进口阀
    function anim1() {
        ht.Default.startAnim({
            duration: 2000,
            action: function (v, t) {
                step1.s('opacity', step1.s('opacity') + (1 - step1.s('opacity')) * v)
                inletValve.setRotation(inletValve.getRotation() + 0.01)
            },
            finishFunc: function () {
                anim2()
            }
        })
    }
    // 2.关闭旁通阀
    function anim2() {
        ht.Default.startAnim({
            duration: 2000,
            action: function (v, t) {
                step1.s('opacity', step1.s('opacity') + (0 - step1.s('opacity')) * v)
                step2.s('opacity', step2.s('opacity') + (1 - step2.s('opacity')) * v)
                bypassValve.setRotation(bypassValve.getRotation() + 0.01)
            },
            finishFunc: function () {
                anim3()
            }
        })
    }
    // 3.关闭出口球阀
    function anim3() {
        ht.Default.startAnim({
            duration: 2000,
            action: function (v, t) {
                step2.s('opacity', step2.s('opacity') + (0 - step2.s('opacity')) * v)
                step3.s('opacity', step3.s('opacity') + (1 - step3.s('opacity')) * v)
                outletValve.setRotation(outletValve.getRotation() + 0.01)
            },
            finishFunc: function () {
                anim4()
            }
        })
    }
    // 4.打开放空球阀
    function anim4() {
        ht.Default.startAnim({
            duration: 2000,
            action: function (v, t) {
                step3.s('opacity', step3.s('opacity') + (0 - step3.s('opacity')) * v)
                step4.s('opacity', step4.s('opacity') + (1 - step4.s('opacity')) * v)
                ventingBallValveF.setRotation(ventingBallValveF.getRotation() + 0.01)
                ventingBallValveB.setRotation(ventingBallValveB.getRotation() + 0.01)
            },
            finishFunc: function () {
                anim5()
            }
        })
    }
    // 5.缓慢打开节流截止放空球阀
    function anim5() {
        ht.Default.startAnim({
            duration: 2000,
            action: function (v, t) {
                step4.s('opacity', step4.s('opacity') + (0 - step4.s('opacity')) * v)
                step5.s('opacity', step5.s('opacity') + (1 - step5.s('opacity')) * v)
                ventingValve.setRotation(ventingValve.getRotation() - 0.01)
            },
            finishFunc: function () {
                anim6()
            }
        })
    }
    // 6.观察压力表压力降到1MPa以下
    function anim6() {
        ht.Default.startAnim({
            duration: 2000,
            action: function (v, t) {
                step5.s('opacity', step5.s('opacity') + (0 - step5.s('opacity')) * v)
                step6.s('opacity', step6.s('opacity') + (1 - step6.s('opacity')) * v)
            }
        })
        timer = setInterval(function(){
            pressurePanel.s('2d.visible', !pressurePanel.s('2d.visible'))
        }, 500)
        setTimeout(function(){
            clearInterval(timer)
            pressurePanel.s('2d.visible', false)
            anim7()
        },4000)
    }
    // 7.关闭放空阀和放空球阀
    function anim7() {
        ht.Default.startAnim({
            duration: 2000,
            action: function (v, t) {
                step6.s('opacity', step6.s('opacity') + (0 - step6.s('opacity')) * v)
                step7.s('opacity', step7.s('opacity') + (1 - step7.s('opacity')) * v)
                ventingBallValveF.setRotation(ventingBallValveF.getRotation() - 0.01)
                ventingValve.setRotation(ventingValve.getRotation() + 0.01)
                ventingBallValveB.setRotation(ventingBallValveB.getRotation() - 0.01)
            },
            finishFunc: function () {
                anim8()
            }
        })
    }
    // 8.打开排污球阀
    function anim8() {
        ht.Default.startAnim({
            duration: 2000,
            action: function (v, t) {
                step7.s('opacity', step7.s('opacity') + (0 - step7.s('opacity')) * v)
                step8.s('opacity', step8.s('opacity') + (1 - step8.s('opacity')) * v)
                dischargeBallValveF.setRotation(dischargeBallValveF.getRotation() - 0.01)
                dischargeBallValveB.setRotation(dischargeBallValveF.getRotation() - 0.01)
            },
            finishFunc: function () {
                anim9()
            }
        })
    }
    // 9.缓慢打开排污阀排污
    function anim9() {
        ht.Default.startAnim({
            duration: 2000,
            action: function (v, t) {
                step8.s('opacity', step8.s('opacity') + (0 - step8.s('opacity')) * v)
                step9.s('opacity', step9.s('opacity') + (1 - step9.s('opacity')) * v)
                dischargeValve.setRotation(dischargeValve.getRotation() - 0.01)
            },
            finishFunc: function () {
                // 排污中
                ht.Default.startAnim({
                    duration: 4000,
                    action: function (v, t) {
                        liquidLevel.setPosition(liquidLevel.getPosition().x, liquidLevel.getPosition().y + 0.25)
                    }
                })
                timer1 = setInterval(function(){
                    pollution.s('2d.visible', !pollution.s('2d.visible'))
                }, 500)
                anim10()
            }
        })
    }
    // 10.关闭排污阀和排污球阀
    function anim10() {
        setTimeout(function(){
            clearInterval(timer1)
            pollution.s('2d.visible', false)
            ht.Default.startAnim({
                duration: 2000,
                action: function (v, t) {
                    step9.s('opacity', step9.s('opacity') + (0 - step9.s('opacity')) * v)
                    step10.s('opacity', step10.s('opacity') + (1 - step10.s('opacity')) * v)
                    dischargeBallValveF.setRotation(dischargeBallValveF.getRotation() + 0.01)
                    dischargeValve.setRotation(dischargeValve.getRotation() + 0.01)
                    dischargeBallValveB.setRotation(dischargeBallValveF.getRotation() + 0.01)
                },
                finishFunc: function () {
                    anim11()
                }
            })
        },4000)
    }
    // 11.再次打开排污阀释放压力
    function anim11() {
        ht.Default.startAnim({
            duration: 2000,
            action: function (v, t) {
                step10.s('opacity', step10.s('opacity') + (0 - step10.s('opacity')) * v)
                step11.s('opacity', step11.s('opacity') + (1 - step11.s('opacity')) * v)
                dischargeValve.setRotation(dischargeValve.getRotation() - 0.01)
            },
            finishFunc: function () {
                // 释压中
                timer2 = setInterval(function(){
                    dischargePressure.s('2d.visible', !dischargePressure.s('2d.visible'))
                }, 500)
                anim12()
            }
        })
    }
    // 12.关闭排污阀
    function anim12() {
        setTimeout(function(){
            clearInterval(timer2)
            dischargePressure.s('2d.visible', false)
            ht.Default.startAnim({
                duration: 2000,
                action: function (v, t) {
                    step11.s('opacity', step11.s('opacity') + (0 - step11.s('opacity')) * v)
                    step12.s('opacity', step12.s('opacity') + (1 - step12.s('opacity')) * v)
                    dischargeValve.setRotation(dischargeValve.getRotation() + 0.01)
                },
                finishFunc: function () {
                    anim13()
                }
            })
        },4000)
    }
    // 13.打开旁通阀对过滤器平衡充压
    function anim13() {
        ht.Default.startAnim({
            duration: 2000,
            action: function (v, t) {
                step12.s('opacity', step12.s('opacity') + (0 - step12.s('opacity')) * v)
                step13.s('opacity', step13.s('opacity') + (1 - step13.s('opacity')) * v)
                bypassValve.setRotation(bypassValve.getRotation() - 0.01)
            },
            finishFunc: function () {
                // 充压中
                ht.Default.startAnim({
                    duration: 4000,
                    action: function (v, t) {
                        liquidLevel.setPosition(liquidLevel.getPosition().x, liquidLevel.getPosition().y - 0.25)
                    }
                })
                timer3 = setInterval(function(){
                    boostPressure.s('2d.visible', !boostPressure.s('2d.visible'))
                }, 500)
                anim14()
            }
        })
    }
    // 14.关闭旁通阀
    function anim14() {
        setTimeout(function(){
            clearInterval(timer3)
            boostPressure.s('2d.visible', false)
            ht.Default.startAnim({
                duration: 2000,
                action: function (v, t) {
                    step13.s('opacity', step13.s('opacity') + (0 - step13.s('opacity')) * v)
                    step14.s('opacity', step14.s('opacity') + (1 - step14.s('opacity')) * v)
                    bypassValve.setRotation(bypassValve.getRotation() + 0.01)
                },
                finishFunc: function () {
                    step14.s('opacity', 0)
                    // anim1() // 循环
                    star.s('opacity', 1)
                }
            })
        },4000)
    }
}

s.onDown:
__ht__function(event, data, view) {
// 隐藏开始按钮
ht.Default.startAnim({
    duration: 1000,
    action: function (v, t) {
        data.s('opacity', data.s('opacity') + (0 - data.s('opacity')) * v)
    }
})
// 开始动画演示
data.a('star')()
}
